// src/App.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';  // Importa la página de inicio
import ExamenList from './FuturePages/ExamenList';  // Importa la página de lista de exámenes
import ExamenForm from './FuturePages/ExamenForm';  // Importa la página de creación/edición de exámenes
import Header from './components/Header';  // Importa el encabezado
import './App.css';  // Estilos generales

const App = () => {
  return (
    <Router>
      <div>
        <Header />  {/* El encabezado aparecerá en todas las páginas */}
        <main>
          <Routes>
            <Route path="/" element={<Home />} />  {/* Página de inicio */}
            <Route path="/examenes" element={<ExamenList />} />  {/* Página de lista de exámenes */}
            <Route path="/crear-examen" element={<ExamenForm />} />  {/* Página de creación de examen */}
          </Routes>
        </main>
      </div>
    </Router>
  );
};

export default App;
